import React from "react";
import { Container, Row, Col } from "react-bootstrap";

import me_pic from "../../images/me.jpg";
import About from "./About.css";

const about = () => {
  console.log("Here in about");
  return (
    <div className="About">
      <Container className="About">
        <Row>
          <Col>1 of 2</Col>
          <Col>2 of 2</Col>
        </Row>
        <Row>
          <Col>1 of 3</Col>
          <Col>2 of 3</Col>
          <Col>3 of 3</Col>
        </Row>
      </Container>
    </div>
  );
};

export default about;
